  It's the moment fans have been waiting for, as David Tennant
  takes over ownership of the Tardis from Christopher Eccleston,
  and embarks on his first adventure with plucky sidekick Billie
  Piper. The new-look Doctor takes Rose home for the festive 
  season, but the regeneration process has knocked the wind out 
  of his sails and he ends up falling unconscious - just as the 
  planet comes under threat from evil alien race the Sycorax, who
  have employed sinister Santas and murderous trees to do their 
  bidding. Camille Coduri and Noel Clarke co-star, with Penelope
  Wilton reprising her role as politician Harriet Jones, who's 
  now the Prime Minister.
